import React from 'react';

function BookCard(props) {
  return (
    <thead>
      <tr>
        <td>{props.title}</td>
        <td>{props.authors}</td>
        <td>{props.description}</td>
        <td>{props.image}</td>
        <td>{props.link}</td>
        <td>{props.email}</td>
      </tr>
    </thead>
  );
}

export default ContactCard;
